const CustomMenu = React.forwardRef(
  ({ children, style, className, 'aria-labelledby': labeledBy }, ref) => {
    const [value, setValue] = useState('');

    return (
      <div
        ref={ref}
        style={style}
        className={className}
        aria-labelledby={labeledBy}
      >
        <ul className="list-unstyled">
          {React.Children.toArray(children).filter(
            (child) =>
              !value || child.props.children.toLowerCase().startsWith(value),
          )}
        </ul>
      </div>
    );
  },
);
function BaruvasLogo(props){
  return (
    <Dropdown onSelect={(eventKey) => {
      props.setUser(eventKey)
      let names = ['baru','liz','daniel','alex']
      for (let name of names) {
        if (name !== eventKey){
          props.setCurrChatName(name)
        }
      }
      }}>
      <Dropdown.Toggle as={BaruvasToggle} id="dropdown-custom-components">
        Custom toggle
      </Dropdown.Toggle>

      <Dropdown.Menu as={CustomMenu}>
        <Dropdown.Item eventKey="baru" active={props.user === 'baru'}>{getDisplayName('baru')}</Dropdown.Item>
        <Dropdown.Item eventKey="liz" active={props.user === 'liz'}>{getDisplayName('liz')}</Dropdown.Item>
        <Dropdown.Item eventKey="daniel" active={props.user === 'daniel'}>
        {getDisplayName('daniel')}
        </Dropdown.Item>
        <Dropdown.Item eventKey="alex" active={props.user === 'alex'}>{getDisplayName('alex')}</Dropdown.Item>
      </Dropdown.Menu>
    </Dropdown>
  )
}

export default BaruvasLogo;